from sympy import isprime
from itertools import product
def auptod(maxdigits):
    alst = []
    for d in range(1, maxdigits+1):
        for p in product("014689", repeat=d-1):
            if d > 1 and p[0] == "0": continue
            for end in "19":
                s = "".join(p) + end
                t = int(s)
                if isprime(t): alst.append(t)
    return alst
